import React from 'react'
import Toolbar from '../UI/Navigation/Toolbar/Toolbar'
import LoginSignUp from '../../container/LoginSignUp/LoginSignUp'
const Layout=()=>{

    return(
    <React.Fragment>
      
        <Toolbar/>
        <LoginSignUp/>
        <p>Body</p>
        
    </React.Fragment>
    )
}

export default Layout;
